import React from "react"
import style from "./MyPosts.module.css"
import Post from "./Post/Post";
import NewPost from "./NewPost/NewPost";

const MyPosts = (props) => {
debugger
    let postsElement =  props.profilePage.posts.map(p => <Post
        avatar={p.avatar} lickCount={p.lickCount} text={p.text} key={p.id}/>)
    return (
        <div className={style.posts}>
            <h2>Posts</h2>
            <NewPost  onAddPost={props.onAddPost}onTextChange={ props.onTextChange} />

            <div className={style.posts}>
               {postsElement}
            </div>
        </div>
    )
}

export default MyPosts
